import "../App.css";

const Home = () => {

    const [allPets, setAllPets] = useState([]);
    useEffect(() => {
        axios
        .get("http://localhost:8000/api/favorites")
        .then((response) => {
            console.log(response.data);
            setAllPets(response.data);
        })
        .catch((err) => {
            console.log(err.response);
        });
    }, []);


    return (
        <div className="container">
            <h1>About</h1>
        </div>
    );
};

export default Home;
